import React from 'react'
import Menu from '../Menu/index'
import './header.css'
import logo from '../img/foice.png'

function Header(){
    return (
        <div className="container">
            <h1>
                Logo
            </h1>
            <Menu />
        </div>
        
    );
}
export default Header;
